import React from "react";
import { Button, Form, Grid, Image, Header } from "semantic-ui-react";

const SemForm = props => (
  <Grid textAlign="center" style={{ height: "100vh" }} verticalAlign="middle">
    <Grid.Column style={{ maxWidth: 450 }}>
      <Header as="h2" color="teal" textAlign="center">
        <Image src="https://dribbble.com/shots/9830501-comphttps://cdn.dribbble.com/users/24078/screenshots/9830501/media/381875f86b8c8ef71cfd53016d974cb9.jpg" />{" "}
        Log-in to your account
      </Header>
      <Form onSubmit={e => props.handleSubmit(e)}>
        <Form.Field>
          <input placeholder="email" />
        </Form.Field>
        <Form.Field>
          <input placeholder="password" />
        </Form.Field>
        <Button type="submit">Submit</Button>
      </Form>
    </Grid.Column>
  </Grid>
);

export default SemForm;
